export function Section(props) {
  console.log(props);

  return (
    <div className="section-items">
      <img src={props.item.img} alt="" className="image"></img>
      <span>
        <span>
          <h3>{props.item.country}</h3>
          <h4>View on Google Maps</h4>
        </span>
        <h1>{props.item.name}</h1>
        <h2>{props.item.date}</h2>
      </span>
    </div>
  );
}
